const getCurrentForecastDetails = (main, wind) => [
    {
        name: 'Pressure',
        value: main.pressure,
        units: 'in'
    },
    {
        name: 'Humidity',
        value: main.humidity,
        units: '%'
    },
    {
        name: 'Wind',
        value: Math.round(wind.speed * 2.237),
        units: 'mph'
    },
    {
        name: 'Min Temp',
        value: Math.round((main.temp_min - 273.15) * 9/5 + 32),
        units: '째F'
    },
    {
        name: 'Max Temp',
        value: Math.round((main.temp_max - 273.15) * 9/5 + 32),
        units: '째F'
    },
]

export default getCurrentForecastDetails
